import React, { useEffect, useState } from 'react';
import axios from 'axios';
import './GoogleEarth.css';

function GoogleEarth() {
  const [data, setData] = useState([]);

  useEffect(() => {
    axios.get('http://127.0.0.1:5000/google-earth')
      .then((response) => {
        setData(response.data);
      })
      .catch((error) => {
        console.error('Error fetching Google Earth data:', error);
      });
  }, []);

  return (
    <div className="google-earth">
      <h2>Google Earth Images</h2>
      <ul>
        {data.map((item, index) => (
          <li key={index}>
            <strong>{item.county}, {item.state}:</strong>
            <img src={item.image_url} alt={`${item.county} image`} />
          </li>
        ))}
      </ul>
    </div>
  );
}

export default GoogleEarth;
